import React, { Component } from 'react';
import { variables } from './Variables.js';

export class Logger extends Component {
    constructor(props) {
        super(props);

        this.state = {
            moods: [],
            mood_id:0,
            mood_name:""
        }
    }

    logClick() {
        fetch(variables.API_URL + moods, {
            method: 'POST',
            headers: {
                'Accept': 'application/json',
                'Content-Type': 'application/json'
            },
            body: JSON.stringify({
                mood_name: this.state.mood_name,
            })
        })
            .then(res => res.json())
            .then((result) => {
                alert(result);
                this.refreshList()
            }, (error) => {
                alert('Failed');
            })
    }
    render() {
        return (
            <div>
                <h3>This is Logger page</h3>
                <button type="button" className="btn btn-primary m-2" >
                    Happy
                </button>
                <button type="button" className="btn btn-primary m-2" >
                    Sad
                </button>
            </div>
        )
    }
}
